import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { useHistory } from "react-router";
// import { useHistory } from "react-router";

import { benefitApi } from "@api";
import { ComponentBenefitItem, ComponentBenefitList } from "@components";
// import { IReward } from "@interfaces";
import { setLoading } from "@redux";
// import { REWARD } from "@configs";
import { IBenefit } from "@interfaces";
import { PATH_BENEFIT } from "@configs";

export const ModulesBenefit = () => {
    //page hooks
    const dispatch = useDispatch();
    const history = useHistory();
    //page state
    const [benefit, setBenefit] = useState<IBenefit[]>([]);

    useEffect(() => {
        (async () => {
            dispatch(setLoading(true));
            const res = await benefitApi.getListBenefit();
            const data = res.data.docs as IBenefit[];
            setBenefit(data);
            dispatch(setLoading(false));
        })();
    }, []);

    const handleClick = (id: string) => {
        history.push(PATH_BENEFIT + "/" + id);
        //
    };

    return <> {benefit && <ComponentBenefitList data={benefit} handleClick={handleClick} />}</>;
};

interface IProps {
    data: IBenefit;
    handleClick: (id: string) => void;
}

export const ModulesBenefitItem = (props: IProps) => {
    //page props
    const { data, handleClick } = props;

    return <> {benefit && <ComponentBenefitItem data={data} handleClick={handleClick} />}</>;
};
